  styleUrls: ['./app.component.scss']
})
export class AppComponent implements OnInit {
  title = 'bm-corretora-front';

  constructor(private primengConfig: PrimeNGConfig) {}

    ngOnInit() {
        this.primengConfig.ripple = true;
    }

